		function resultFeedbackMessage(){
			var currentPoints = Number(this.lastCurrentPoints[this.roundNum-1]);
		  var currentCost = Number(this.lastCurrentCost[this.roundNum-1]);
		  this.pointsText = "";
		  this.costsText = "";
			var optimiserDefinedScore = [118, 113, 80];
		    var optimiserDefinedCost = [50, 50, 31];
			var prioritiserDefinedScore = 115;
		    var optimiserTime = 0.0008;
		    let userTime = (this.timerDuration > this.timerCurrent)
		    ? (this.timerDuration - this.timerCurrent)
		    : this.timerDuration;
		    let comparisonTimeText = "";
		    if (this.roundNum === 1) {
		        comparisonTimeText = "The Optimiser completed its selections in just 0.0008 seconds and the Prioritiser in just 0.0003 seconds";
		    } else {
		        comparisonTimeText = "The Optimiser completed its selection in just " + optimiserTime + " seconds";
		    }
		    this.TimeText = comparisonTimeText + ", while your processing time was " + userTime + " seconds. ";
		    switch (this.roundNum) {
		        case 1: // Level 1: Maximize Points (118) / Max Cost ($50) / Compare to Prioritiser (115)
		            if (currentPoints > optimiserDefinedScore[0]) {
		                this.pointsText = "Outstanding! You surpassed both the Optimiser (" + optimiserDefinedScore[0] + ") and the Prioritiser (" + prioritiserDefinedScore + ") with your benefit points of " + currentPoints + ". ";
		            } else if (currentPoints === optimiserDefinedScore[0]) {
		                this.pointsText = "Excellent! You matched the Optimiser's benefit points (" + optimiserDefinedScore[0] + ") and outperformed the Prioritiser (" + prioritiserDefinedScore + "). ";
		            } else if (currentPoints >= prioritiserDefinedScore) {
		                this.pointsText = "Awesome! You beat the Prioritiser's benefit points (" + prioritiserDefinedScore + ") with your score of " + currentPoints + ", but you're still behind the Optimiser (" + optimiserDefinedScore[0] + "). ";
		            } else {
		                this.pointsText = "Unfortunately, you did not exceed the benefit points of either the Optimiser (" + optimiserDefinedScore[0] + ") or the Prioritiser (" + prioritiserDefinedScore + "). ";
		            }
		            // Cost Feedback (Max $50 constraint)
		            if (currentCost <= optimiserDefinedCost[0]) {
		                let remaining = optimiserDefinedCost[0] - currentCost;
		                this.costsText = "You met the cost constraint of $" + optimiserDefinedCost[0] + (remaining > 0 ? ", though you still have $" + remaining + " remaining in your allowance. " : ". ");
		            } else {
		                this.costsText = "However, you exceeded the cost constraint of $" + optimiserDefinedCost[0] + ". ";
		            }
		            break;
		        case 2: // Level 2: Maximize Points (113) / Max Cost ($50) / Category Cost Objective ($12+ per color)
		            const minCostPerCategory = 12; // The objective is to spend $12 or more per color.
		            const categoryCosts = this.getCategoryCosts();
		            // Check Category Objective: Failure if ANY color is below the minimum
		            let categoryFailed = (categoryCosts.orange < minCostPerCategory || 
		                                  categoryCosts.blue < minCostPerCategory || 
		                                  categoryCosts.purple < minCostPerCategory);
		            // Points Feedback (Optimiser: 113)
		            if (currentPoints > optimiserDefinedScore[1]) {
		                this.pointsText = "Outstanding! You surpassed the Optimiser's benefit points (" + optimiserDefinedScore[1] + ") with your score of " + currentPoints + ". ";
		            } else if (currentPoints === optimiserDefinedScore[1]) {
		                this.pointsText = "Excellent! You matched the Optimiser's benefit points (" + optimiserDefinedScore[1] + "). ";
		            } else {
		                this.pointsText = "You did not match the Optimiser's benefit points (" + optimiserDefinedScore[1] + ") with your score of " + currentPoints + ". ";
		            }
		            // Cost Feedback (Max $50 constraint + Category Constraint)
		            if (currentCost > optimiserDefinedCost[1]) {
		                this.costsText = "You exceeded the total cost constraint of $" + optimiserDefinedCost[1] + ". ";
		            } else if (categoryFailed) {
		                this.costsText = "You stayed within the total cost constraint ($" + optimiserDefinedCost[1] + ") but failed the objective, spending less than $" + minCostPerCategory + " in one or more colors. ";
		            } else { 
		                this.costsText = "Crucially, you met both the total cost constraint ($" + optimiserDefinedCost[1] + ") and the objective (spending $" + minCostPerCategory + " or more per color). ";
		            }
		            break;
		        case 3: // Level 3: Goal Points (80) / Least Cost (Optimiser $31)
		            const goalPoints = optimiserDefinedScore[2]; // 80
		            const optimiserLeastCost = optimiserDefinedCost[2]; // 31
		            // Points Feedback (Did they hit the goal?)
		            if (currentPoints >= goalPoints) {
		                this.pointsText = "Excellent! You met the client's minimum benefit goal of " + goalPoints + " points (your score: " + currentPoints + "). ";
		            } else {
		                this.pointsText = "Unfortunately, you did not meet the client's minimum benefit goal of " + goalPoints + " points (your score: " + currentPoints + "). ";
		            }
		            // Cost Feedback (Least Cost optimization)
		            if (currentCost < optimiserLeastCost) {
		                this.costsText += "Furthermore, you beat the Optimiser, achieving the goal for only $" + currentCost + ", which is less than the Optimiser's $" + optimiserLeastCost + ". ";
		            } else if (currentCost === optimiserLeastCost) {
		                this.costsText += "You matched the Optimiser, achieving the goal at the optimized cost of $" + optimiserLeastCost + ". ";
		            } else if (currentCost <= 50) {
		                this.costsText += "You achieved the goal, but at $" + currentCost + ", your cost was higher than the Optimiser's minimum of $" + optimiserLeastCost + ". ";
		            } else {
		                this.costsText += "You greatly exceeded the soft budget of $50, making your result inefficient. ";
		            }
		            break;
		    }
		  this.instructions = "Scroll down to compare your selected projects with those chosen by the Optimiser. Click next to learn more.";
		  return(this.pointsText + this.costsText + this.TimeText);
		}
		function captureSubmittedCards() {
		    const roundIdx = this.roundNum - 1;
		    let totalPoints = 0;
		    let totalCost = 0;
		    const sourceCards = this.selectedCards[roundIdx];
		    if (this.roundNum === 2) {
		        this.lastCurrentCards[roundIdx] = [[], [], []];
		    } else {
		        this.lastCurrentCards[roundIdx] = []; 
		    }
		    if (Array.isArray(sourceCards[0])) {
		        for (let i = 0; i < sourceCards.length; i++) {
		            for (let j = 0; j < sourceCards[i].length; j++) {
		                const cardObj = sourceCards[i][j];
		                const cardType = cardObj._cardType;
		                const parsed = parsePointsAndCost(cardType);
		                totalPoints += parsed.points;
		                totalCost += parsed.cost;
		                this.lastCurrentCards[roundIdx][i].push(cardType); 
		            }
		        }
		    } else {
		        for (let i = 0; i < sourceCards.length; i++) {
		            const cardType = sourceCards[i]._cardType;
		            const parsed = parsePointsAndCost(cardType);
		            totalPoints += parsed.points;
		            totalCost += parsed.cost;
		            this.lastCurrentCards[roundIdx].push(cardType); 
		        }
		    }
		    //Update the final results (points and cost)
		    this.lastCurrentPoints[roundIdx] = String(totalPoints);
		    this.lastCurrentCost[roundIdx] = String(totalCost);
			this.lastCurrentTime[roundIdx] = this.timerCurrent;
		}
		function updateResultSelectionButtons() {
		    if (!this.obj_results || !this.obj_results.obj_levelSelection) return;

		    this.currentRoundPage = this.obj_pages['obj_r' + this.roundNum + 'page'];
		    this.currentResultsPage = this.obj_results['obj_result' + this.roundNum];

		function getPanelColor(panel) {
		    if (this.roundNum !== 2 && this.selectedPanels.flat().includes(panel)) return "all";
		    if (this.obj_levels && this.obj_levels.obj_level2 && panel === this.obj_levels.obj_level2.obj_sprojectPanelO) return "orange";
		    if (this.obj_levels && this.obj_levels.obj_level2 && panel === this.obj_levels.obj_level2.obj_sprojectPanelB) return "blue";
		    if (this.obj_levels && this.obj_levels.obj_level2 && panel === this.obj_levels.obj_level2.obj_sprojectPanelP) return "purple";
		    if (this.projectPanels.includes(panel)) return "project";
		    return null;
		}
		function getGridPosition(index) {
		    var isProjectPanel = this._isLayingOutProjectPanel;
		    var settings = isProjectPanel
		        ? this.projectPanelSettings[this.roundNum - 1]
		        : this.panelSettings[this.roundNum - 1];
		    var col = index % settings.maxColumns;
		    var row = Math.floor(index / settings.maxColumns);
		    var cardSpacing = STATIC_CARD_SPACING;
		    return {
		        x: panelPadding + col * (cardWidth + cardSpacing),
		        y: panelPadding + row * (settings.cardHeight + bottomPadding)
		    };
		}
		function getCardContentHeight(cardsArray) {
		    if (!cardsArray.length) return panelHeight;
		    var lastIndex = cardsArray.length - 1;
		    var pos = getGridPosition.call(this, lastIndex);
		    return pos.y + cardHeight + panelPadding;
		}
		function parsePointsAndCost(cardType) {
		    var match = cardType.match(/^([obp])_p(\d+)_c(\d+)$/i);
		    if (!match) return { color: null, points: 0, cost: 0 };
		    var colorMap = { o: "orange", b: "blue", p: "purple" };
		    var color = colorMap[match[1].toLowerCase()] || match[1];
		    return {
		        color: color,
		        points: Number(match[2]),
		        cost: Number(match[3])
		    };
		}
		function makeDraggable(card, timeline) {
		    card.on("mousedown", function(evt) {
		        timeline.playSoundEffect(timeline, timeline.sfx.cardPickup); 
		        isDragging = true;
		        draggedCard = card;
		        var roundIdx = timeline.roundNum - 1;
		        var parentArr = timeline.cards;
		        var indexInParent = parentArr.indexOf(card);
		        var sourcePanel = card.parent;
		        var scrollObj = timeline.projectScroll; 
		        if (indexInParent === -1) {
		            if (Array.isArray(timeline.selectedCards[roundIdx][0])) {
		                for(let i = 0; i < timeline.selectedCards[roundIdx].length; i++) {
		                    if (timeline.selectedCards[roundIdx][i].indexOf(card) >= 0) {
		                        parentArr = timeline.selectedCards[roundIdx][i];
		                        indexInParent = parentArr.indexOf(card);
		                        sourcePanel = timeline.selectedPanels[roundIdx][i];
		                        scrollObj = timeline.selectedScrolls[roundIdx][i];
		                        break;
		                    }
		                }
		            } else {
		                if (timeline.selectedCards[roundIdx].indexOf(card) >= 0) {
		                    parentArr = timeline.selectedCards[roundIdx];
		                    indexInParent = parentArr.indexOf(card);
		                    sourcePanel = timeline.selectedPanels[roundIdx][0];
		                    scrollObj = timeline.selectedScrolls[roundIdx][0];
		                }
		            }
		        }
		        dragOrigin = {
		            panel: sourcePanel,
		            array: parentArr,
		            index: indexInParent,
		            x: card.x,
		            y: card.y,
		            scrollObj: scrollObj || timeline.projectScroll
		        };
		        if (dragOrigin.array && dragOrigin.index !== -1) {
		            dragOrigin.array.splice(dragOrigin.index, 1);
		        }
		        var global = card.parent.localToGlobal(card.x, card.y);
		        stage.addChild(card); 
		        layoutCards.call(timeline, dragOrigin.panel, dragOrigin.array, 300, dragOrigin.scrollObj.value);
		        card.x = (evt.stageX / stage.scaleX) - cardWidth/2;
		        card.y = (evt.stageY / stage.scaleY) - cardHeight/2;
		        offset.x = cardWidth/2;
		        offset.y = cardHeight/2;
		        stage.on("stagemousemove", dragHandler);
		        stage.on("stagemouseup", dropHandler.bind(timeline));
		    });
		}
		function dragHandler(evt) {
		    if (!isDragging || !draggedCard) return;
		    draggedCard.x = (evt.stageX / stage.scaleX) - offset.x;
		    draggedCard.y = (evt.stageY / stage.scaleY) - offset.y;
		}
		function dropHandler(evt) {
		    if (!isDragging || !draggedCard) return;
		    var card = draggedCard;
		    isDragging = false;
		    draggedCard = null;
		    var roundIdx = this.roundNum - 1;
		    var dropPanels = this.selectedPanels[roundIdx];
		    var projectPanel = this.projectPanels[roundIdx];
		    stage.removeChild(card);
		    var cardInfo = parsePointsAndCost(card._cardType);
		    var cardColor = cardInfo.color; 
		    let foundPanel = null;
		    let foundPanelIdx = -1;
		    let successfulMatchFound = false;

		                    playVO.call(this, this.roundNum, this.currentInitialPage, 0); 
		                    break;
		                case "btn_back":
		                    stopAllVO.call(this);
							this.currentRoundPage.gotoAndPlay("out" + this.currentInitialPage);
		                    if(this.currentInitialPage != 0){
		                        this.currentInitialPage--;
		                    }
		                    playVO.call(this, this.roundNum, this.currentInitialPage, 0); 
		                    break;

		                        this.currentResultInitialPage++;

		                    this.currentResultsPage.gotoAndStop(this.currentResultInitialPage);

		                    if(this.currentResultInitialPage != 0){
		                        this.currentResultInitialPage--;
		                    }
		                    this.currentResultsPage.gotoAndStop(this.currentResultInitialPage);
		                    break;
		                case "btn_nextLevel":
		                    this.roundNum++;
		                    whichLevel.call(this, this);
		                    this.currentPage = "Round" + this.roundNum;
		                    this.gotoAndPlay("exit");
		                    moveSelectedEffectTo.call(this, this.roundNum, false);
							this.txt_stageRound.txt_gRound.text = "Level " + this.roundNum;
							playVO.call(this, this.roundNum, 0, 2.5);
		                    break;
		                case "btn_mute":
		                    this.isMuted = !this.isMuted;
		                    this.bgMusic.muted = this.isMuted;
		                    this.btn_mute.mcIcon.gotoAndStop(this.isMuted ? 1 : 0);
		                    createjs.Sound.muted = this.isMuted;
		                    stage.update();
							const mcContainer = this.obj_pages.obj_how2;
							//const mcContainer = this.obj_how2;
							if (mcContainer && mcContainer._htmlVideoElement) {
								mcContainer._htmlVideoElement.muted = this.isMuted;
								if (!this.isMuted) {
									mcContainer._htmlVideoElement.play().catch(e => {
										//console.log("Video playback resume failed after unmute.", e);
									});
								}
							}
		                    if (!this.isMuted && this.bgMusic.paused) this.bgMusic.play();
		                    break;
		                case "btn_pp":
							this.callPrompt("Pause");
		                    this.isPlaying = !this.isPlaying;
		                    this.btn_pp.mcIcon.gotoAndStop(!this.isPlaying ? 1 : 0);
		                    if (this.isPlaying){
		                        this.playTimer();
		                        this.obj_timer.obj_clock.gotoAndPlay();
		                        this.obj_logo.edaLogo.gotoAndPlay();
		                        if(!this.isMuted && this.bgMusic && typeof this.bgMusic.play === 'function'){ this.bgMusic.play(); }
		                    }else{
		                        this.pauseTimer();
		                        this.obj_logo.edaLogo.gotoAndStop();
		                        if (this.bgMusic && typeof this.bgMusic.pause === 'function') {
		                            this.bgMusic.pause();
		                        }
		                    }
		                    break;
		                default:
		                    break;
		            }
		            break;
		        default:
		            break;
		    }
			if (e.type === "click") {
		        this.playSoundEffect(this, this.sfx.click);
		    }
		}
		this.embedVideoToContainer = function(mcContainer, videoID, loadQueue) {
		    if (!mcContainer || !mcContainer.nominalBounds) {
		        console.error("Video container MC not found or lacks nominalBounds.");
		        return;
		    }
		    const videoData = loadQueue.getItem(videoID);
		    if (!videoData) {
		        console.error("Video asset was not loaded by the specified queue:", videoID);
		        return;
		    }
		    const videoElement = document.createElement('video');
		    videoElement.id = 'videoPlayer-' + videoID;
		    videoElement.className = 'absolute-video';
		    videoElement.src = videoData.src;
		    videoElement.controls = true;      
		    videoElement.autoplay = false; 
		    videoElement.playsInline = true; 
		    videoElement.loop = false;
		    videoElement.muted = this.isMuted; 
		    videoElement.style.position = 'absolute'; 
		    videoElement.style.transform = 'translate(-50%, -50%)'; // video scale
		    videoElement.style.transformOrigin = 'center center';   // video center
		    const canvasParent = stage.canvas.parentElement || document.body;
		    canvasParent.appendChild(videoElement);
		    mcContainer._htmlVideoElement = videoElement;
		    const AUTOPLAY_DELAY_MS = 2000;
		    setTimeout(() => {
		        videoElement.play().catch(e => {
		            console.warn(`Video autoplay failed after ${AUTOPLAY_DELAY_MS/1000}s delay.`, e);
		        });
		    }, AUTOPLAY_DELAY_MS);
		    (function(timeline, element) {
		        let lastMutedState = timeline.isMuted;
		        function checkMuteStatus() {  }
		        element.addEventListener('volumechange', checkMuteStatus);
		        mcContainer._muteInterval = setInterval(checkMuteStatus, 100); 
		    })(this, videoElement); 
		    mcContainer._muteInterval = null;
		}
		function updateVideoPosition() {
			const mcContainer = this.obj_pages.obj_how2;
			const videoElement = mcContainer ? mcContainer._htmlVideoElement : null;
			const videoParent = stage.canvas.parentElement;
			if (!videoElement || !stage.canvas || !mcContainer.nominalBounds || !videoParent) {
				return;
			}
			const nominalW = mcContainer.nominalBounds.width;
			const nominalH = mcContainer.nominalBounds.height;
			const scale = stage.scaleX || 1; 
			const finalW = nominalW * scale;
			const finalH = nominalH * scale;
			videoElement.style.width = `${finalW}px`;
			videoElement.style.height = `${finalH}px`;
			const mcCenterOnScreen = stage.localToGlobal(
				mcContainer.x + nominalW / 2,
				mcContainer.y + nominalH / 2
			);
			const parentRect = videoParent.getBoundingClientRect();
			const finalLeftRelativeToParent = mcCenterOnScreen.x - parentRect.left;
			const finalTopRelativeToParent = mcCenterOnScreen.y - parentRect.top;
			const windowCenterOffsetX = (window.innerWidth - finalW) / 2;
			const windowCenterOffsetY = (window.innerHeight - finalH) / 2;
			videoElement.style.left = `${finalLeftRelativeToParent + windowCenterOffsetX}px`;
			videoElement.style.top = `${finalTopRelativeToParent + windowCenterOffsetY}px`;
		}
		this.removeVideoFromStage = function(mcContainer) {
		    if (mcContainer && mcContainer._htmlVideoElement) {
		        const videoElement = mcContainer._htmlVideoElement;
		        videoElement.pause();
		        if (mcContainer._muteInterval) {
		            clearInterval(mcContainer._muteInterval);
		            mcContainer._muteInterval = null;
		        }
		        if (videoElement.parentElement) {
		            videoElement.parentElement.removeChild(videoElement);
		        }
		        mcContainer._htmlVideoElement = null; // Clear reference
		    }
		}
		function stopAllVO() {
		    for (let i = this.activeVOs.length - 1; i >= 0; i--) {
		        const instance = this.activeVOs[i];
		        if (instance && instance.stop) {
		            instance.stop();
		        }
		    }
		    this.activeVOs.length = 0; // Clear the array
		    /*if (!this.isMuted && this.bgMusic && this.bgMusic.paused) {
		        this.bgMusic.play(); 
		    }*/
		}
		this.playSoundEffect = function(root, id) {
			//console.log(root +"  "+ id +"  "+ root.isMuted);
		    if (root.isMuted) return;
		    try {
		        const sfxInstance = createjs.Sound.play(id);
		        sfxInstance.volume = getAudioVolume.call(root, id); 
		    } catch (e) {
		        console.log("SFX play failed or was prevented:", e);
		    }
		}
		function playVO(type, pageIndex, delay) {
		    if (this.isMuted) return;
		    stopAllVO.call(this); 
		    let audioId;
		    audioId = this.voAudio[type][pageIndex];
		    if (audioId) {
		        setTimeout(() => {
		            try {
		                const voInstance = createjs.Sound.play(audioId);
		                voInstance.volume = getAudioVolume.call(this, audioId);
		                this.activeVOs.push(voInstance); // Track the new VO instance
		                // Remove instance from active list when finished
		                voInstance.on("complete", () => {
		                    const index = this.activeVOs.indexOf(voInstance);
		                    if (index > -1) {
		                        this.activeVOs.splice(index, 1);
		                    }
		                    /*if (!this.isMuted && this.bgMusic && this.bgMusic.paused) {
		                        this.bgMusic.play(); 
		                    }*/
		                });
		            } catch (e) {
		                 //console.log("VO play failed or was prevented:", e);
		            }
		        }, delay * 1000);
		    }
		}
		this.restartCards = restartCards;
		this.restartTimer = restartTimer;
		this.callPrompt = callPrompt;
		this.showResultsWindow = showResultsWindow;
		this.formatTime = function(sec) {
		    var m = Math.floor(sec / 60);
		    var s = sec % 60;
		    return (m < 10 ? "0" : "") + m + ":" + (s < 10 ? "0" : "") + s;
		}
		this.panelAndCardsArr_refresh = function(panel) {
		    if(panel && panel.children.length){
		        for (var i = panel.children.length - 1; i >= 0; i--) {
		            var child = panel.children[i];
		            if (child._cardType) { 
		                panel.removeChild(child);
		            }
		        }
		    }
		}
		this.startCardSetup = function(cardsArr, panel, cardsObjArr, scrollOffset, draggable) {
		    if (!panel || !panel.addChild) {
		        console.error("startCardSetup: Panel is invalid or undefined. Skipping card setup for", cardsArr);
		        return;
		    }
		    this.panelAndCardsArr_refresh(panel);
		    this._isLayingOutProjectPanel = (panel === this.projectPanels[this.roundNum - 1]);
		    cardsObjArr.length = 0; 
		    for (var i = 0; i < cardsArr.length; i++) {
		        var CardClass = lib[cardsArr[i]];
		        if (!CardClass) continue;
		        var card = new CardClass();
		        card.cardWidth = cardWidth;
		        card.cardHeight = cardHeight;
		        card.cursor = (draggable) ? "pointer" : "default";
		        card._originPanel = this.projectPanel;
		        card._originalProjectIndex = i;
		        card._cardType = cardsArr[i];
		        var pos = getGridPosition.call(this, i);
		        card.x = pos.x;
		        card.y = pos.y;
		        panel.addChild(card);
		        cardsObjArr.push(card);
		        if (draggable) makeDraggable(card, this);
		    }
		    addScrollbarToPanel.call(this, panel, cardsObjArr, scrollOffset, visibleRows);
		    this._isLayingOutProjectPanel = false;
		}
		this.getCategoryCosts = function() {
		    var costs = { orange: 0, blue: 0, purple: 0 };
		    var roundIdx = this.roundNum - 1;
		    if (this.roundNum === 2 && Array.isArray(this.selectedCards[roundIdx][0])) {
		        costs.orange += this.selectedCards[roundIdx][0].reduce((sum, cardObj) => sum + parsePointsAndCost(cardObj._cardType || "").cost, 0);
		        costs.blue += this.selectedCards[roundIdx][1].reduce((sum, cardObj) => sum + parsePointsAndCost(cardObj._cardType || "").cost, 0);
		        costs.purple += this.selectedCards[roundIdx][2].reduce((sum, cardObj) => sum + parsePointsAndCost(cardObj._cardType || "").cost, 0);
		    }
		    return costs;
		}
		this.updatePointsAndCosts = function() {
		    var totalPoints = 0, totalCost = 0;
		    var roundIdx = this.roundNum - 1;
			var costLimit = 50;
		    if (this.lastCurrentCards[roundIdx]) {
		        this.lastCurrentCards[roundIdx].length = 0; 
		    } else {
		        this.lastCurrentCards[roundIdx] = [];
		    }
		    if (Array.isArray(this.selectedCards[roundIdx][0])) {
		        for (let i = 0; i < this.selectedCards[roundIdx].length; i++) {
		            for (let j = 0; j < this.selectedCards[roundIdx][i].length; j++) {
		                var cardObj = this.selectedCards[roundIdx][i][j];
		                var parsed = parsePointsAndCost(cardObj._cardType || "");
		                totalPoints += parsed.points;
		                totalCost += parsed.cost;
		                this.lastCurrentCards[roundIdx].push(cardObj._cardType); // Store in the correct level slot
		            }
		        }
		    } else {
		        for (var i = 0; i < this.selectedCards[roundIdx].length; i++) {
		            var cardObj = this.selectedCards[roundIdx][i];
		            var parsed = parsePointsAndCost(cardObj._cardType || "");
		            totalPoints += parsed.points;
		            totalCost += parsed.cost;
		            this.lastCurrentCards[roundIdx].push(cardObj._cardType); // Store in the correct level slot
		        }
		    }
		    this.lastCurrentPoints[this.roundNum-1] = String(totalPoints);
		    this.lastCurrentCost[this.roundNum-1] = String(totalCost);
		    if (this.obj_points && this.obj_points.txt_points) {
		        this.obj_points.txt_points.text = String(totalPoints);
		    }
		    if (this.obj_costs && this.obj_costs.txt_cost) {
		        this.obj_costs.txt_cost.text = totalCost + " / " + costLimit;
		        this.obj_costs.txt_cost.color = (totalCost > costLimit) ? "#da291c" : "#0C0808";
		    }
		    if (this.roundNum === 2 && this.obj_level2CostBreakDown && this.obj_level2CostBreakDown.visible) {
		        var categoryCosts = this.getCategoryCosts();
		        var maxCostPerCategory = 12;
		        var goodColor = "#0C0808";
		        var badColor = "#da291c";
		        this.obj_level2CostBreakDown.txt_costsO.text = String(categoryCosts.orange);
		        this.obj_level2CostBreakDown.txt_costsO.color = (categoryCosts.orange < maxCostPerCategory) ? badColor : goodColor;
		        this.obj_level2CostBreakDown.txt_costsB.text = String(categoryCosts.blue);
		        this.obj_level2CostBreakDown.txt_costsB.color = (categoryCosts.blue < maxCostPerCategory) ? badColor : goodColor;
		        this.obj_level2CostBreakDown.txt_costsP.text = String(categoryCosts.purple);
		        this.obj_level2CostBreakDown.txt_costsP.color = (categoryCosts.purple < maxCostPerCategory) ? badColor : goodColor;
		    }
		}
		this.updateTimerDisplay = function(ctx) {
		    ctx.obj_timer.text_timer.text = this.formatTime(ctx.timerCurrent);
		    ctx.obj_timer.text_timer.color = (ctx.timerCurrent <= 31) ? "#da291c" : "#0C0808";
		}
		this.playTimer = function() {
		    if (this.timerInterval) return;
		    var timeline = this;
		    this.timerInterval = setInterval(function() {
		        if (timeline.timerCurrent > 0) {
		            timeline.timerCurrent--;
		            timeline.updateTimerDisplay(timeline);
		            timeline.timerRanOut = false;
		        } else {
		            clearInterval(timeline.timerInterval);
		            timeline.timerInterval = null;
		            timeline.timerExpired();
		        }
		    }, 1000);
		    if(this.obj_timer && this.obj_timer.obj_clock) this.obj_timer.obj_clock.gotoAndPlay();
		}
		this.pauseTimer = function() {
		    if (this.timerInterval) {
		        clearInterval(this.timerInterval);
		        this.timerInterval = null;
		        if(this.obj_timer && this.obj_timer.obj_clock) this.obj_timer.obj_clock.gotoAndStop();
		    }
		}
		this.timerExpired = function() {
		    this.timerRanOut = true;
		    if(this.obj_timer && this.obj_timer.obj_clock) this.obj_timer.obj_clock.gotoAndStop();
		    this.callPrompt("TimerRanOut");
		}
		this.initializeAudio = function() {
		    this.bgMusic = createjs.Sound.play("bgMusic", { loop: -1 });
		    this.bgMusic.volume = getAudioVolume.call(this, "bgMusic"); 
		    this.bgMusic.muted = this.isMuted;
		    setTimeout(function() {
		        if (this.bgMusic && typeof this.bgMusic.pause === 'function') {
		            this.bgMusic.pause();
		        }
		    }.bind(this), 1);
		}
		function getAudioVolume(id) {
		    const item = this.queue.getItem(id);
		    if (item && typeof item.volume === 'number') {
		        return item.volume;
		    }
		    return 0.5; 
		}

		    //addMenuBtnListeners.call(this, this.obj_pages.obj_how.btn_hReturn);

		            let hasPrevResults = false;
		            if (prevCards) {

		                updateIndicatorForContainer.call(this, resultLevelsContainer);
		                updateResultSelectionButtons.call(this); 
		            }.bind(this));
		            btn.addEventListener("mouseover", function() {
		                if (btn.obj_btnLevelDisabled && btn.obj_btnLevelDisabled.visible) return;
		                resultBtnLevels.forEach(b => b.gotoAndStop(0)); 
		                btn.gotoAndStop(1); 
		                const selectedEffect = resultLevelsContainer.obj_selectedEffect;
		                createjs.Tween.removeTweens(selectedEffect);
		                createjs.Tween.get(selectedEffect)
		                    .to({x: btn.x, y: btn.y}, 150, createjs.Ease.quadOut);
		            }.bind(this));
		            btn.addEventListener("mouseout", function() {
		                const selectedEffect = resultLevelsContainer.obj_selectedEffect;
		                const selectedBtn = resultBtnLevels[this.roundNum - 1];
		                btn.gotoAndStop(0);
		                if (this.roundNum === level) {
		                    btn.gotoAndStop(1); 
		                }
		                if (selectedBtn) {
		                    createjs.Tween.removeTweens(selectedEffect);
		                    createjs.Tween.get(selectedEffect)
		                        .to({x: selectedBtn.x, y: selectedBtn.y}, 150, createjs.Ease.quadOut);
		                }
		            }.bind(this));
		        });
		        const initialButton = resultBtnLevels[this.roundNum - 1];
		        if (initialButton) {
		            resultBtnLevels.forEach(b => b.gotoAndStop(0));
		            initialButton.gotoAndStop(1); 
		        }
		        updateIndicatorForContainer.call(this, resultLevelsContainer); 
		    }
		    updateResultButtonState.call(this, this.roundNum);
		    moveSelectedEffectTo.call(this, this.roundNum, false); 
		    createjs.Ticker.on("tick", updateVideoPosition.bind(this));
		    updateMenuLevelButtons.call(this);
		}).call(this);
	}
